import { Component } from "react"
class Main extends Component{
    render(){
        return(
            <div className="container" style={{marginTop:"12em"}}>

            
            <div className="row">
            <header>Personal Details</header>
            <div className="row form">
                <input type="text"/>
            </div>
            </div>
            </div>
            )
    }
}
export default Main
